import React from "react";
import styled from "styled-components";
import Gengar from "../assets/image/gengar.png";
import Blastoise from "../assets/image/blastoise.png";
import Charizard from "../assets/image/charizard.png";
import Bulbasaur from "../assets/image/bulbasaur.png";
import Squirtle from "../assets/image/squirtle.png";
import Pikachu from "../assets/image/Pikachu.png";

export const LandingPage = () => {
  return (
    <Container>
      <img
        style={{ width: "150px" }}
        src={Gengar}
        alt="imagen de pokemon"
        className="gengar"
      />
      <img
        style={{ width: "150px" }}
        src={Blastoise}
        alt="imagen de pokemon"
        className="blastoise"
      />
      <img
        style={{ width: "150px" }}
        src={Charizard}
        alt="imagen de pokemon"
        className="charizard"
      />
      <img
        style={{ width: "150px" }}
        src={Bulbasaur}
        alt="imagen de pokemon"
        className="bulbasaur"
      />
      <img
        style={{ width: "150px" }}
        src={Squirtle}
        alt="imagen de pokemon"
        className="squirtle"
      />
    </Container>
  );
};

const Container = styled.div`
  width: 100vw;
  height: 100vh;
  position: relative;
  background: linear-gradient(red, white);
  .gengar{
    position: absolute;
    top: 5%;
    left: 5%;
  }
  .blastoise{
    position: absolute;
    bottom: 5%;
    left: 5%;
  }
  .charizard{
    position: absolute;
    bottom: 5%;
    right: 5%;
  }
`;
